  title: Nnwdaf_AnalyticsInfo
  version: 1.2.0-alpha.5
externalDocs:
  description: 3GPP TS 29.520 V17.5.0; 5G System; Network Data Analytics Services.
  url: http://www.3gpp.org/ftp/Specs/archive/29_series/29.520/
servers:
- url: '{apiRoot}/nnwdaf-analyticsinfo/v1'
  variables:
    apiRoot:
      default: https://example.com
      description: apiRoot as defined in subclause 4.4 of 3GPP TS 29.501.
security:
- {}
- oAuth2ClientCredentials:
  - nnwdaf-analyticsinfo
paths:
  /analytics:
    get:
      operationId: get_nwdaf_analytics
      parameters:
      - description: Identify the analytics.
        in: query
        name: event-id
        schema:
          $ref: '#/components/schemas/EventId'
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/EventReportingRequirement'
        description: Identifies the analytics reporting requirement information.
        in: query
        name: ana-req
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/EventFilter'
        description: Identify the analytics.
        in: query
        name: event-filter
      - description: To filter irrelevant responses related to unsupported features
        in: query
        name: supported-features
        required: false
        schema:
          $ref: '#/components/schemas/SupportedFeatures'
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/TargetUeInformation'
        description: Identify the target UE information.
        in: query
        name: tgt-ue
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/AnalyticsData'
          description: Containing the analytics with parameters as relevant for the
            requesting NF service consumer.
        "204":
          description: No Content (The request NWDAF Analytics data does not exist)
        "400":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Bad request
        "401":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Unauthorized
        "403":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Forbidden
        "404":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Indicates that the NWDAF Analytics resource does not exist.
        "406":
          description: 406 Not Acceptable
        "414":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: URI Too Long
        "429":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Too Many Requests
        "500":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetailsAnalyticsInfoRequest'
          description: The request is rejected by the NWDAF and more details (not
            only the ProblemDetails) are returned.
        "503":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Service Unavailable
        default:
          description: Generic Error
      summary: Read a NWDAF Analytics
      tags:
      - NWDAF Analytics (Document)
      x-openapi-router-controller: openapi_server.controllers.nwdaf_analytics_document_controller
  /context:
    get:
      operationId: get_nwdaf_context
      parameters:
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/ContextIdList'
        description: Identifies specific context information related to analytics
          subscriptions.
        in: query
        name: context-ids
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/RequestedContext'
        description: Identfies the type(s) of the analytics context information the consumer wishes to receive.
        in: query
        name: req-context
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ContextData'
          description: Contains context information related to analytics subscriptions
            corresponding with one or more context identifiers.
        "204":
          description: No Content (No context information could be retrieved for the
            requested context identifiers).
        "400":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Bad request
        "401":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Unauthorized
        "403":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Forbidden
        "404":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Not Found
        "406":
          description: 406 Not Acceptable
        "414":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: URI Too Long
        "429":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Too Many Requests
        "500":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Internal Server Error
        "503":
          content:
            application/problem+json:
              schema:
                $ref: '#/components/schemas/ProblemDetails'
          description: Service Unavailable
        default:
          description: Generic Error
      summary: Get context information related to analytics subscriptions.
      tags:
      - NWDAF Context (Document)
      x-openapi-router-controller: openapi_server.controllers.nwdaf_context_document_controller
