            encoded as defined in clause 5.4.2 ("Mnc" data type definition) <NFType>
            encoded as a value defined in Table 6.1.6.3.3-1 of 3GPP TS 29.510 but
            with lower case characters <Set ID> encoded as a string of characters
            consisting of alphabetic characters (A-Z and a-z), digits (0-9) and/or
