    Tai:
      description: Contains the tracking area identity as described in 3GPP 23.003
      example:
        tac: tac
        nid: nid
        plmnId:
          mnc: mnc
          mcc: mcc
      properties:
        plmnId:
          $ref: '#/components/schemas/PlmnId'
        tac:
          description: 2 or 3-octet string identifying a tracking area code as specified
            in clause 9.3.3.10 of 3GPP TS 38.413, in hexadecimal representation. Each
            character in the string shall take a value of "0" to "9", "a" to "f" or
            "A" to "F" and shall represent 4 bits. The most significant character
            representing the 4 most significant bits of the TAC shall appear first
            in the string, and the character representing the 4 least significant
            bit of the TAC shall appear last in the string.
          pattern: (^[A-Fa-f0-9]{4}$)|(^[A-Fa-f0-9]{6}$)
          title: Tac
          type: string
        nid:
          description: This represents the Network Identifier, which together with
            a PLMN ID is used to identify an SNPN (see 3GPP TS 23.003 and 3GPP TS
            23.501 clause 5.30.2.1).
          pattern: ^[A-Fa-f0-9]{11}$
          title: Nid
          type: string
      required:
      - plmnId
      - tac
      title: Tai
      type: object
    PlmnId:
      description: When PlmnId needs to be converted to string (e.g. when used in
        maps as key), the string shall be composed of three digits "mcc" followed
        by "-" and two or three digits "mnc".
      example:
        mnc: mnc
        mcc: mcc
      properties:
        mcc:
          description: Mobile Country Code part of the PLMN, comprising 3 digits,
            as defined in clause 9.3.3.5 of 3GPP TS 38.413.
          pattern: ^\d{3}$
          title: Mcc
          type: string
        mnc:
          description: Mobile Network Code part of the PLMN, comprising 2 or 3 digits,
            as defined in clause 9.3.3.5 of 3GPP TS 38.413.
          pattern: ^\d{2,3}$
          title: Mnc
          type: string
      required:
      - mcc
      - mnc
      title: PlmnId
      type: object
