          pattern: ^[A-Fa-f0-9]+$
          title: N3IwfId
          type: string
        gNbId:
          $ref: '#/components/schemas/GNbId'
        ngeNbId:
          description: This represents the identifier of the ng-eNB ID as specified
            in clause 9.3.1.8 of 3GPP TS 38.413. The value of the ng-eNB ID shall
            be encoded in hexadecimal representation. Each character in the string
            shall take a value of "0" to "9", "a" to "f" or "A" to "F" and shall represent
            4 bits. The padding 0 shall be added to make multiple nibbles, so the
            most significant character representing the padding 0 if required together
            with the 4 most significant bits of the ng-eNB ID shall appear first in
            the string, and the character representing the 4 least significant bit
            of the ng-eNB ID (to form a nibble) shall appear last in the string.
          example: SMacroNGeNB-34B89
          pattern: ^(MacroNGeNB-[A-Fa-f0-9]{5}|LMacroNGeNB-[A-Fa-f0-9]{6}|SMacroNGeNB-[A-Fa-f0-9]{5})$
